import React, { Component } from "react";
import Arm from "./Arm";
import { Row, Col, Container, Button } from "react-bootstrap";

class Control extends Component {
  state = {};
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col>
              <Arm className="m-3"></Arm>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Control;
